O serviço a ser contratado deverá atender aos seguintes requisitos:
•	Fornecimento e aplicação de adesivo jateado de alta qualidade, com durabilidade mínima prevista e resistência à luz solar e limpeza periódica;
•	Adequação do material e da aplicação às normas de segurança e boas práticas de acabamento;
•	Execução do serviço por equipe qualificada, garantindo acabamento profissional e sem danos às superfícies;
•	Cumprimento integral dos prazos estabelecidos no Termo de Referência;
•	Indicação de especificações técnicas detalhadas, como tipo de material, dimensões, garantia e metodologia de aplicação;

2.1. O Conselho Regional de Psicologia da 6ª Região realiza o envio das Carteiras de Identidade Profissional (CIP) por meio dos Correios, como parte do atendimento regular aos profissionais registrados.

2.2. A contratação objetiva adquirir etiquetas adesivas com instruções padronizadas que serão afixadas nos envelopes contendo as CIP, com orientações sobre o acesso ao Boletim de Recebimento da Carteira (BRC) e a necessidade de confirmação de recebimento.

2.3. A impressão dessas etiquetas no próprio CRP-SP mostrou-se inviável devido:

ao elevado volume de emissões;

à necessidade de qualidade e precisão gráfica, pois falhas podem comprometer a leitura;

à limitação de estrutura técnica da unidade demandante para atender à demanda com a qualidade exigida.

2.4. A contratação de serviço externo especializado para fornecimento das etiquetas impressas permitirá:

padronização visual e informativa;

maior agilidade no processo de preparação das correspondências;

eliminação de falhas operacionais.

2.5. Espera-se, com a contratação, melhorar a experiência do profissional que recebe a CIP, garantindo clareza nas instruções de uso e confirmação do recebimento, além de assegurar eficiência e economicidade na operação.

