Diante da necessidade de aquisição de cadeiras reforçadas para o Conselho Regional de Psicologia de São Paulo, faz se necessária a compra das referidas cadeiras a fim de atender a acessibilidade, o respeito à diversidade corporal e a promoção de condições adequadas de conforto e segurança a todos os usuários.

As cadeiras convencionais, normalmente com capacidade para até 100 kg, não oferecem resistência adequada nem garantem estabilidade para pessoas com sobrepeso ou obesidade, podendo representar riscos à integridade física dos usuários, como quedas, quebras do mobiliário ou acidentes que podem acarretar danos físicos e jurídicos à instituição.

Além disso, a presença de mobiliário adaptado demonstra a preocupação da instituição com a inclusão, atendendo aos princípios da dignidade da pessoa humana e às diretrizes da Lei Brasileira de Inclusão da Pessoa com Deficiência (Lei nº 13.146/2015), que também abrange pessoas com obesidade em situações de mobilidade reduzida ou limitações funcionais.

Ademais, a aquisição dessas cadeiras visa:

Garantir o conforto, segurança e bem-estar de todos os usuários, sem discriminação;

Prevenir acidentes e preservar a integridade física dos colaboradores, visitantes ou pacientes;

Promover um ambiente mais acessível, inclusivo e adequado às diferentes necessidades corporais;

Cumprir normas técnicas e orientações de ergonomia e acessibilidade;

Reduzir custos com manutenção e substituição de mobiliário inadequado.

A não aquisição dessas cadeiras acarretará prejuízo no conforto, na segurança, no bem-estar, na prevenção de acidentes, na preservação da integridade física dos colaboradores, na promoção de um ambiente mais acessível, inclusivo, adequado às necessidades corporais e no comprimento de normas técnicas e orientações de ergonomia e acessibilidade.
Portanto, é imprescindível que o ambiente esteja equipado com cadeiras projetadas para suportar pesos maiores, com estrutura reforçada, dimensões adequadas e materiais de alta durabilidade, garantindo a inclusão plena e segura.

A presente contratação busca modernizar a infraestrutura institucional, criando um ambiente adequado para:

Aprimorar a qualidade dos treinamentos internos e externos, com recursos tecnológicos que forneçam a interação e a transmissão de conhecimento;

Promover a produção de conteúdos digitais (podcasts, webinars, videoaulas e transmissões ao vivo), fortalecendo a comunicação da Jucer com a sociedade, empreendedores e demais órgãos públicos;

Ampliar a transparência e a acessibilidade, permitindo a difusão de informações de interesse público por meio de diferentes plataformas digitais;

Capacitar servidores para a correta utilização e manutenção dos equipamentos, garantindo autonomia, eficiência e qualidade na operação do espaço;

Apoiar ações de governo digital, alinhadas às diretrizes de inovação, eficiência e modernização da Administração Pública.

Dessa forma, os objetivos da contratação estão diretamente vinculados ao fortalecimento institucional, à melhoria da prestação de serviços públicos e à disseminação de informações de forma clara, acessível e moderna.

